contracts/manager/Candel_1s/Kandel_1s_Ma.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../../interface/IKlineManager.sol";

contract Kandle_1s_Manager is IKlineManager {
    string public constant INTERVAL_1S = "1s";
    mapping(uint256 => KlineResponse) private candles; // Lưu trữ nến theo timestamp
    uint256[] private timestampList; // Danh sách timestamp để lấy dữ liệu

   // Candle[] public candles;
    function recordKline(KlineRecord calldata kline) external override {
        require(keccak256(bytes(kline.i)) == keccak256(bytes(INTERVAL_1S)), "Interval must be 1s");
        uint256 timestamp = kline.t; // Sử dụng startTime làm key
        // Tạo KlineResponse
        uint currentTime =block.timestamp;
        KlineResponse memory klineResponse = KlineResponse({
            e: "kline", // Giả định event type
            E: currentTime, // Thời gian ghi nhận
            s: kline.s, // Symbol
            k: kline
        });

        candles[currentTime] = klineResponse;
        timestampList.push(currentTime);
        // candles.push(KlineResponse);

        emit AddKlineRecord(timestamp, kline.s, kline.o, kline.c);
    }

    function getKline(uint256 timestamp)
        external
        view
        override
        returns (KlineResponse memory)
    {
        return candles[timestamp];
    }

    function getAllKline()
        external
        view
        override
        returns (KlineResponse[] memory)
    {
        KlineResponse[] memory reslut = new KlineResponse[](
            timestampList.length
        );
        for (uint256 i = 0; i < timestampList.length; i++) {
            reslut[i] = candles[timestampList[i]];
        }
        return reslut;
    }

    function getLength() public view returns (uint256) {
        return timestampList.length;
    }

    function getKlineFrom(uint256 fromTimestamp)
        external
        view
        returns (KlineResponse[] memory)
    {
        uint256 count = 0;
        uint256 currentTime = block.timestamp;
        for (uint256 i = 0; i < timestampList.length; i++) {
            uint256 ts = timestampList[i];
            if (ts >= fromTimestamp && ts <= currentTime) {
                count++;
            }
        }
        KlineResponse[] memory result = new KlineResponse[](count);
        uint256 index = 0;

        for (uint256 i = 0; i < timestampList.length; i++) {
            uint256 ts = timestampList[i];
            if (ts >= fromTimestamp && ts <= currentTime) {
                result[index] = candles[ts];
                index++;
            }
        }
        return result;
    }
}

contracts/interface/IKlineManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../struct/CandleStruct.sol";
interface IKlineManager {
    event AddKlineRecord(uint256 timestamp, string symbol, string open, string close);
    
    function recordKline(KlineRecord calldata kline) external;
    function getKline(uint256 timestamp) external view returns (KlineResponse memory);
    // function getLastKline() external view returns (CandleResponse memory);
    function getAllKline() external  view returns (KlineResponse[] memory);
    function getLength() external  view returns (uint256) ;
    // function getCandleInRange(
    //     uint256 fromTimestamp,
    //     uint256 toTimestamp
    // ) external view returns (CandleResponse[] memory);
     function getKlineFrom(uint256 fromTimestamp)
        external
        view
        returns (KlineResponse[] memory);
    // function getKlinesPaginated(uint256 startTimestamp, uint256 limit, uint256 offset) external view  returns (CandleRecord[] memory);
}

